import { RouterProvider, createBrowserRouter } from 'react-router-dom';
import LandingPage from './LandingPage';
import Login from './Authentication/Login/Login';
import Register from './Authentication/register/Register';
import StoreView from './Themes/Aqua/StoreView/StoreView';

function App() {

  const AuthorizedRoutes = [
    {
      path:"/Dashboard",
      element:<Dashboard/>
    },
    // {
    //   path:"/storesetup",
    //   element:<StoreSetup/>
    // },
  ]

  const UnauthorizedRoutes= [
    {
      path:"/",
      element:<LandingPage/>
    },
    {
      path:"/login",
      element:<Login/>
    },
    {
      path:"/register",
      element:<Register/>
    },
    {
      path:"/store",
      element:<StoreView/>
    },

  ]

  const router = createBrowserRouter( [...UnauthorizedRoutes,...AuthorizedRoutes] )


  return (
    <>
    <RouterProvider router={router}/>
    </>
  );
}

export default App;
